"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Usual dose:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Adults: 0.5-1.5 mg once daily prior to bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Elderly: 0.5 mg once daily prior to bedtime; maximum dose: 1 mg",
