"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:0em;\">",
"     Capsule: 0.5 mg, 1 mg, 2 mg",
"    </p>",
"    <p style=\"text-indent:0em;\">",
