" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Assessment for inadequate provision of affection, nurturance, or love",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Ask:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        How does the parent describe the child and his or her feelings toward the child?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        How does the parent show the child affection?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is there something about the child that is difficult for the parent to accept? (eg, unwanted pregnancy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        How satisfied is the parent with his or her role as a parent?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What is the child's perception of the parent's approach to him or her?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Observe:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is there warmth, affection, and caring in the parent child interactions?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
