var title_f10_52_11085="Composite Asthma Severity Index";
var content_f10_52_11085=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F82978&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F82978&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Composite Asthma Severity Index (CASI) scorecard",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1_single\">",
"        Final score*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Day symptoms and albuterol in the last 2 wk (15 percent of total score)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0-3",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4-9",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10-13",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        14",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Night symptoms and albuterol in the last 2 wk (15 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0-1",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3-4",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5-14",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Lung function measures (15 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        FEV",
"        <sub>",
"         1",
"        </sub>",
"        percent &gt;85",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        FEV",
"        <sub>",
"         1",
"        </sub>",
"        percent = 80-84",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        FEV",
"        <sub>",
"         1",
"        </sub>",
"        percent = 70-79",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        FEV",
"        <sub>",
"         1",
"        </sub>",
"        percent &lt;70",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Controller treatment (25 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No treatment",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Albuterol as needed",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Low-dose ICS",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Low-dose ICS + LABA or medium-dose ICS",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Medium-dose ICS + LABA",
"       </td>",
"       <td>",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        High-dose ICS",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Exacerbations (30 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prednisone burst",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prednisone burst + hospitalization",
"       </td>",
"       <td>",
"        4",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\">",
"        Maximum possible score",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        20",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ICS: inhaled corticosteroids; LABA: long-acting b-agonists.",
"     <br/>",
"     * Scoring example: A participant taking albuterol as needed with 2 nights of symptoms, 5 days of symptoms, an FEV",
"     <sub>",
"      1",
"     </sub>",
"     value 87 percent of predicted, and 1 prednisone burst (without hospitalization) in the last 2 months would have a final CASI score of 5 (1 point for day symptoms, 1 point for night symptoms, 1 point for controller treatment, 0 points for lung function measures, and 2 points for exacerbations).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Singulair should be considered equivalent to low-dose ICS and scored as 2 points.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Wildfire JJ, Gergen PJ, Sorkness CA, et al. Development and validation of the Composite Asthma Severity Index - an outcome measure for use in children and adolescents. J Allergy Clin Immunol 2012; 129:694. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
