" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Different patterns in the evolution of specific antibody and total immunoglobulin G (IgG) levels  Abnormal response",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 376px; height: 603px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Time course of serum tetanus toxoid antibodies (blue) and IgG levels (red) in four patients (C and D in this figure; A and B in accompanying figure) demonstrating various patterns in the evolution of specific antibody and IgG levels. Black arrowheads represent immunization with tetanus and diphtheria toxoid, poliovirus and Bordetella pertussis. The area above the dashed line indicates normal levels of tetanus toxoid antibodies (&ge;0.05 IU/mL). An abnormal pattern in which the patient failed to make specific antibodies after reimmunization and remained hypogammaglobulinemic (Figure C). An abnormal pattern in which the patient had substantial but unsustained response to reimmunization with a slow rise in total IgG to normal levels (Figure D).",
"    <div class=\"footnotes\">",
"     ABs: antibodies.",
"    </div>",
